import React from 'react'
import { StyleSheet, Text, View } from 'react-native';

const data = (props) => {
    return (
        <View style={styles.container}>
            <Text style={styles.text}>n Tomatoes: {props.nTomaotes}</Text>
            <Text style={styles.text}>T.Time: {props.time}</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        fontSize: 40,
    },
    text: {
        fontSize: 25
    }

})

export default data
